import{_ as e,a as r}from"./chunks/rtk_here_plug_gps_to_6pin_connector.BSTnlEjh.js";import{_ as i,c as o,a8 as a,o as l}from"./chunks/framework.BDnHobkS.js";const S=JSON.parse('{"title":"HEX/ProfiCNC Here2 GPS (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/gps_hex_here2.md","filePath":"uk/gps_compass/gps_hex_here2.md"}'),s={name:"uk/gps_compass/gps_hex_here2.md"};function n(d,t,c,h,p,g){return l(),o("div",null,t[0]||(t[0]=[a('<h1 id="hex-proficnc-here2-gps-discontinued" tabindex="-1">HEX/ProfiCNC Here2 GPS (Discontinued) <a class="header-anchor" href="#hex-proficnc-here2-gps-discontinued" aria-label="Permalink to &quot;HEX/ProfiCNC Here2 GPS (Discontinued)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This has been superseded by the <a href="https://www.cubepilot.com/#/here/here3" target="_blank" rel="noreferrer">Cube Here 3</a></p></div><p>The <a href="http://www.proficnc.com/all-products/152-gps-module.html" target="_blank" rel="noreferrer">Here2 GPS receiver</a> is an update to the Here GPS module from HEX.</p><p>Основні функції включають:</p><ul><li>Одночасний прийом до 3 GNSS (GPS, Galileo, GLONASS, BeiDou)</li><li>Найкраща в галузі навігаційна чутливість -167 дБм</li><li>Безпека та захист цілісності</li><li>Підтримує всі системи супутникового доповнення</li><li>Просунуте виявлення перешкод і спуфінгу</li></ul><img src="'+e+'"><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><ul><li><a href="http://www.proficnc.com/all-products/152-gps-module.html" target="_blank" rel="noreferrer">ProfiCNC</a> (Australia)</li><li><a href="http://www.proficnc.com/stores" target="_blank" rel="noreferrer">Other resellers</a></li></ul><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p>Налаштування та використання PX4 відбувається за принципом «підключи і працюй».</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>If the GPS is <em>not detected</em> then <a href="https://docs.cubepilot.org/user-guides/here-2/updating-here-2-firmware" target="_blank" rel="noreferrer">update the Here2 firmware</a>.</li><li>If the GPS is detected but does not work, attempt the process outlined in <a href="https://docs.cubepilot.org/user-guides/here-2/here-2-can-mode-instruction" target="_blank" rel="noreferrer">allocating node uavcan ID</a>.</li></ul></div><h2 id="підключення-та-з-єднання" tabindex="-1">Підключення та з&#39;єднання <a class="header-anchor" href="#підключення-та-з-єднання" aria-label="Permalink to &quot;Підключення та з&#39;єднання&quot;">​</a></h2><p>The Here2 GPS comes with an 8 pin connector that can be inserted directly into the <a href="http://www.hex.aero/wp-content/uploads/2016/07/DRS_Pixhawk-2-17th-march-2016.pdf" target="_blank" rel="noreferrer">Pixhawk 2</a> GPS UART port.</p><p>У Pixhawk 3 Pro та Pixracer є роз&#39;єм для GPS з 6 контактами. Для цих контролерів ви можете модифікувати GPS-кабель (як показано нижче), видаливши контакти 6 і 7.</p><img src="'+r+'" width="500px"><p>Виводи 6 і 7 призначені для кнопки безпеки - їх також можна прикріпити за потреби.</p><h3 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h3><p>Схема виводів Here2 GPS наведена нижче. Це може бути використано для модифікації роз&#39;єму для інших плат автопілота.</p><table tabindex="0"><thead><tr><th>pin</th><th>Here2 GPS</th><th>pin</th><th>Pixhawk 3 Pro GPS</th></tr></thead><tbody><tr><td>1</td><td>VCC_5V</td><td>1</td><td>VCC</td></tr><tr><td>2</td><td>GPS_RX</td><td>2</td><td>GPS_TX</td></tr><tr><td>3</td><td>GPS_TX</td><td>3</td><td>GPS_RX</td></tr><tr><td>4</td><td>SCL</td><td>4</td><td>SCL</td></tr><tr><td>5</td><td>SDA</td><td>5</td><td>SDA</td></tr><tr><td>6</td><td>BUTTON</td><td>-</td><td>-</td></tr><tr><td>7</td><td>BUTTON_LED</td><td>-</td><td>-</td></tr><tr><td>8</td><td>GND</td><td>6</td><td>GND</td></tr></tbody></table><h2 id="специфікація" tabindex="-1">Специфікація <a class="header-anchor" href="#специфікація" aria-label="Permalink to &quot;Специфікація&quot;">​</a></h2><ul><li><strong>Processor:</strong> STM32F302</li><li><strong>Sensor</strong><ul><li><strong>Compass, Gyro, Accelerometer:</strong> ICM20948</li><li><strong>Barometer:</strong> MS5611</li></ul></li><li><strong>Receiver Type:</strong> 72-channel u-blox M8N engine, GPS/QZSS L2 C/A, GLONASS L10F, BeiDou B11, Galileo E1B/C, SBAS L1 C/A: WAAS, EGNOS, MSAS, GAGAN</li><li><strong>Navigation Update Rate:</strong> Max: 10 Hz</li><li><strong>Positionaing Accuracy:</strong> 3D Fix</li><li><strong>Time to first fix:</strong><ul><li><strong>Cold start:</strong> 26s</li><li><strong>Aided start:</strong> 2s</li><li><strong>Reacquisition:</strong> 1s</li></ul></li><li><strong>Sensitivity:</strong><ul><li><strong>Tracking &amp; Navigation:</strong> -167 dBm</li><li><strong>Hot start:</strong> -148 dBm</li><li><strong>Cold start:</strong> -157 dBm</li></ul></li><li><strong>Assisted GNSS</strong><ul><li>AssistNow GNSS Online</li><li>AssistNow GNSS Offline (до 35 днів)</li><li>AssistNow Autonomous (до 6 днів)</li><li>OMA SUPL&amp; 3GPP compliant</li></ul></li><li><strong>Oscillator:</strong> TCXO (NEO-8MN/Q)</li><li><strong>RTC crystal:</strong> Build in</li><li><strong>ROM:</strong> Flash (NEO-8MN)</li><li><strong>Available Antennas:</strong> Active Antenna &amp; Passive Antenna</li><li><strong>Signal Integrity:</strong> Signature feature with SHA 256</li><li><strong>Protocols &amp; Interfaces:</strong><ul><li><strong>UART/I2C/CAN:</strong> JST_GH Main interface, Switch internally.</li><li><strong>STM32 Main Programming Interface:</strong> JST_SUR</li></ul></li></ul>',21)]))}const f=i(s,[["render",n]]);export{S as __pageData,f as default};
